import React, { Component } from 'react'
import styled from 'styled-components'

// Components
import FullScreen from '../fullscreen'
import Topic from '../topic'

const Wrapper = styled(FullScreen)`
  width: 30%;
  padding-left: 50px;
  padding-right: 50px;
  display: inline-block;
  vertical-align: top;
`

const Container = styled.div`
  margin: 0 0 20px;
`

const Title = styled.p``

const Time = styled.p`
  color: #a7c7f9;
  font-size: 0.8rem;
`

const Detail = styled.p`
  color: #afb5bf;
  font-size: 0.8rem;
`

class Working extends Component {
  render() {
    return (
      <Wrapper>
        <Topic>Working</Topic>
        {this.props.workins.map(working => (
          <Container>
            <Title>{working.title}</Title>
            <Time>June 2017 - Now</Time>
            <Detail>Part-Time: Full-Stack Web Development</Detail>
          </Container>
        ))}
        <Container>
          <Title>Askforanywork</Title>
          <Time>June 2017 - Now</Time>
          <Detail>Part-Time: Full-Stack Web Development</Detail>
        </Container>
        <Container>
          <Title>Institute of High Performance Computing in Singapore</Title>
          <Time>May 2018 - Aug 2018</Time>
          <Detail>Internship: Big Data Analytics and Machine Learning</Detail>
        </Container>
        <Container>
          <Title>Artificial Anything</Title>
          <Time>Jul 2017</Time>
          <Detail>Internship: Embedded System Implementation</Detail>
        </Container>
      </Wrapper>
    )
  }
}

export default Working
